import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Navbar from '../Navbar';
import '../components/StockDetails.css';

const StockDetails = () => {
  const { companyName } = useParams();
  const [stockDetails, setStockDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStockDetails = async () => {
      try {
        const response = await fetch(`http://localhost:5000/api/stocks/company/${encodeURIComponent(companyName)}`);
        
        if (!response.ok) {
          throw new Error(`Error fetching stock details: ${response.statusText}`);
        }

        const data = await response.json();
        
        console.log('Fetched stock details:', data);
        
        if (data && data.company_name) {
          setStockDetails(data);
        } else {
          throw new Error('No valid stock details found');
        }

        setLoading(false);
      } catch (error) {
        console.error('Error fetching stock details:', error);
        setError(error.message);
        setLoading(false);
      }
    };

    fetchStockDetails();
  }, [companyName]);

  if (loading) {
    return <div>Loading stock details...</div>;
  }

  if (error) {
    return <div>Error fetching stock details: {error}</div>;
  }

  return (
    <div>
      <Navbar />
      {stockDetails ? (
        <div className="stock-details-container">
          <h1 className="company-name">{stockDetails.company_name || 'Company Name'}</h1>
          <div className="summary-container">
            <div className="left-side">
              <div className="price-summary box">
                <h3>Price Summary</h3>
                <p>TODAY'S HIGH: ₹{stockDetails.today_high ?? 'N/A'}</p>
                <p>TODAY'S LOW: ₹{stockDetails.today_low ?? 'N/A'}</p>
                <p>52 Week High: ₹{stockDetails.week_52_high ?? 'N/A'}</p>
                <p>52 Week LOW: ₹{stockDetails.week_52_low ?? 'N/A'}</p>
              </div>
              <div className="recommendations box">
                <h3>Buy/Sell Recommendations</h3>
                <p>Current Price: ₹{stockDetails.current_price ?? 'N/A'}</p>
                <p>Mean Price Target: ₹{stockDetails.mean_price_target ?? 'N/A'}</p>
                <p>High Price Target: ₹{stockDetails.high_price_target ?? 'N/A'}</p>
                <p>Low Price Target: ₹{stockDetails.low_price_target ?? 'N/A'}</p>
              </div>
            </div>
            <div className="right-side">
              <div className="company-essentials box">
                <h3>Company Essentials</h3>
                <p>Market Cap: ₹{stockDetails.market_cap ?? 'N/A'}</p>
                <p>No. of Shares: {stockDetails.no_of_shares ?? 'N/A'} Cr</p>
                <p>Sales Growth: {stockDetails.sales_growth ?? 'N/A'}%</p>
                <p>ROE: {stockDetails.roe ?? 'N/A'}%</p>
                <p>ROCE: {stockDetails.roce ?? 'N/A'}%</p>
                <p>Profit Growth: {stockDetails.profit_growth ?? 'N/A'}%</p>
              </div>
            </div>
          </div>
        </div>
      ) : (
        <div>No stock details found.</div>
      )}
    </div>
  );
};

export default StockDetails;
